import React from 'react'
import Canvas from "./Components/Canvas"

import LoadBar from "./Components/LoadBar"

class App extends React.Component {
  render() {
    return (
    	<React.Fragment>
    	<LoadBar />
        <Canvas />
        </React.Fragment>
    );
  }
}
export default App;
